import { 
  BrowserRouter as Router,
  Switch, Route
 } from "react-router-dom"

import Main from "./pages/Main"
import Admin from "./pages/Admin";
import NavBar from "./common/navbar";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Main/>
        </Route>
        <Route  path="/admin">
          <Admin/>
        </Route>

      </Switch>

    </Router>
  );
}

export default App;
